const CHUNK_SIZE = 100; //  
const MAX_HEIGHT = 2; //     
let existingChunks = {};
let currentScene = 0; //     
let selects = [];
let playerPosition = new BABYLON.Vector3(0, 0, 0); //  

var createScene = async function () {
    //     
    for (let i = 0; i < biomes.length; i++) {
        selects[i] = await createBiomeScene(i);
    }

    setTimeout(function () {
        engine.runRenderLoop(function () {
            selects[currentScene].render();
            updateChunks();
        });
    }, 500);
};

async function createBiomeScene(biomeIndex) {
    const scene = new BABYLON.Scene(engine);
    const cameraPosition = new BABYLON.Vector3(0, 10, -15); //   
    const camera = new BABYLON.FreeCamera("camera" + biomeIndex, cameraPosition, scene);
    camera.setTarget(BABYLON.Vector3.Zero());
    camera.attachControl(canvas, true);
    
    const light = new BABYLON.HemisphericLight("light" + biomeIndex, new BABYLON.Vector3(0, 1, 0), scene);
    light.intensity = 0.7;

    //     
    generateChunks(biomeIndex, scene, camera.position);

    //  GUI    
    createSwitchButton(scene, biomeIndex, camera);

    return scene;
}

function createSwitchButton(scene, biomeIndex, camera) {
    var advancedTextureMain = BABYLON.GUI.AdvancedDynamicTexture.CreateFullscreenUI("UI", true, scene);
    var panel = new BABYLON.GUI.StackPanel();
    panel.horizontalAlignment = BABYLON.GUI.Control.HORIZONTAL_ALIGNMENT_CENTER;
    panel.verticalAlignment = BABYLON.GUI.Control.VERTICAL_ALIGNMENT_TOP; //   TOP
    panel.top = "10px"; //   
    advancedTextureMain.addControl(panel);
    
    var buttonChangeScene = BABYLON.GUI.Button.CreateSimpleButton("switchButton", "Switch Dimension");
    buttonChangeScene.width = '170px';
    buttonChangeScene.height = "50px";
    buttonChangeScene.color = "white";
    buttonChangeScene.background = biomeIndex === 0 ? "grey" : "red"; //   
    buttonChangeScene.cornerRadius = "10";
    buttonChangeScene.paddingBottom = "10px";
    panel.addControl(buttonChangeScene); 

    buttonChangeScene.onPointerUpObservable.add(() => {
        selects[currentScene].detachControl();
        currentScene = (currentScene + 1) % biomes.length; //    
        
        //   
        if (currentScene === 1) {
            const currentCameraPosition = camera.position;
            camera.position.x = currentCameraPosition.x + 3500; //   X
            camera.position.z = currentCameraPosition.z + 3900; //   Z
        }

        selects[currentScene].attachControl();
        console.log(`Switched to dimension ${currentScene + 1}`);

        //     
        generateChunks(currentScene, selects[currentScene], camera.position);
    });
}

function updateChunks() {
    const cameraPosition = selects[currentScene].activeCamera.position;

    if (cameraPosition.x !== playerPosition.x || cameraPosition.z !== playerPosition.z || cameraPosition.y !== playerPosition.y) {
        playerPosition = cameraPosition.clone(); 

        //     
        generateChunks(currentScene, selects[currentScene], playerPosition);
    }
}

function generateChunks(biomeIndex, scene, cameraPosition) {
    const chunkX = Math.floor(cameraPosition.x / CHUNK_SIZE);
    const chunkZ = Math.floor(cameraPosition.z / CHUNK_SIZE);
    const chunkY = Math.floor(cameraPosition.y / CHUNK_SIZE); //   Y

    for (let x = chunkX - 2; x <= chunkX + 2; x++) {
        for (let z = chunkZ - 2; z <= chunkZ + 2; z++) {
            for (let y = chunkY - MAX_HEIGHT; y <= chunkY + MAX_HEIGHT; y++) { //   Y
                const chunkId = `${x},${y},${z}`; //   
                if (!existingChunks[chunkId]) {
                    createCorridor(chunkId, x * CHUNK_SIZE, y * CHUNK_SIZE, z * CHUNK_SIZE, scene); //  
                    existingChunks[chunkId] = true; //   
                }
            }
        }
    }
}

function createCorridor(chunkId, x, y, z, scene) {
    const biome = biomes[currentScene]; //      
    return createMeshFromArrays(biome.vertices, biome.faces, scene, chunkId, x, y, z, biome.texture);
}

function createMeshFromArrays(vertices, faces, scene, chunkId, x, y, z, textureURL) {
    const positions = [];
    const indices = [];

    vertices.forEach(vertex => {
        positions.push(vertex[0] + x, vertex[1] + y, vertex[2] + z); //   Y
    });

    faces.forEach(face => {
        indices.push(face[0], face[1], face[2]); //  
        indices.push(face[2], face[1], face[0]); //  
    });

    const mesh = new BABYLON.Mesh(chunkId, scene);
    const vertexData = new BABYLON.VertexData();

    vertexData.positions = positions;
    vertexData.indices = indices;

    vertexData.applyToMesh(mesh);

    const material = new BABYLON.StandardMaterial(`material_${chunkId}`, scene);
    material.diffuseTexture = new BABYLON.Texture(textureURL, scene);
    material.backFaceCulling = false;

    mesh.material = material;

    return mesh;
}

